2. Define a helper function that recursively divides the array into two halves:

    int divide(int* array, int start, int end);

3. Initialize an auxiliary variable to keep track of the index of the current mid-point of the array:

    int mid = 0;

4. Start with the first element of the array:

    mid = divide(array, 0, size);

5. If the current mid-point is less than or equal to size/2:

    if (mid < size/2) {
